<div class=""row"">
    <div class=""region region-iconos-secciones"">
        <h2 class=""block-title"">HISTORIA DE QHAPACÑAN </h2>
    </div>


    <section class=""col-sm-12"">
        <div class=""content"">
            <div style=""text-align: justify"" property=""schema:text"" class=""field field--name-body field--type-text-with-summary field--label-hidden field--item"">
                <p>El 16 de noviembre de 1532, Cajamarca es escenario de uno de los episodios más importantes de la historia peruana y americana: la captura del Inca Atahualpa y el final del imperio del Tahuantins");
            WriteLiteral(@"uyo. Al producirse la conquista española las siete guarangas de Cajamarca fueron otorgadas como encomiendas a Melchor Verdugo, quien comenzó a explotar las minas de Chilete. Cajamarca fue el primer establecimiento andino que en términos occidentales de la época, correspondió al concepto de ciudad pero cuando la visitó Pedro Cieza de León en 1545, estaba arrasada y abandonada, y sólo unos pocos españoles vinieron a establecerse, pese a que como dice el cronista ""Esta provincia es fertilísima"".</p>
                <p>En 1549 llegan los franciscanos, quienes bautizaron el pueblo con el nombre de San Antonio de Cajamarca. En 1564 se creó el corregimiento que comprendía las provincias de Huambos, Cajamarca y Huamachuco. Hacia 1574 se fundó el primer obraje, propiedad de doña Jordana Mejía, viuda del encomendero Melchor Verdugo. Al iniciarse el siglo XVII comienza una etapa de crecimiento económico y demográfico, sustentado en el desarrollo agrícola y ganadero, especialmente en la cría de ovejas que abastecieron l");
            WriteLiteral(@"a lana de los obrajes, cuya producción fue la más significativa. Cajamarca como en la época de los Incas se convirtió en el núcleo textil más importante del virreynato. A mediados del mismo siglo se consolida la propiedad rural; proliferan las estancias y surge el latifundismo, tanto por el sistema de la compra-venta como por el sistema del despojo de las tierras de las comunidades indígenas. Poco después comienza la edificación de las iglesias y las casonas de los grandes hacendados.</p>
                <p>En 1772 se descubrieron las minas de plata de Hualgayoc, hecho que va a producir enorme transformación en la economía regional al supeditar la producción agraria y la obrajera a la explotación de las minas. Los agricultores cajamarquinos deslumbrados con la posibilidad de enriquecerse , abandonan sus estancias y los hacendados sus obrajes, haciendas y ganados para volcarse a Hualgayoc convirtiéndola -pese a su clima y duras condiciones de vida- en una desordenada y desenfrenada concentración humana; miner");
            WriteLiteral(@"os azogueros, comerciantes y aventureros de toda calaña se trasladaron allí de todas partes del virreynato.</p>
                <p>En 1782 la provincia constituida en partidos tenía una población de 7835 españoles, 22 299 mestizos y 29 692 indígenas. Se acrecentó la población española y Cajamarca se amestizó considerablemente. El auge de Hualgayoc duró hasta fines del siglo XVIII, cuando comenzaron a agotarse las vetas. En 1802, la villa fue elevada al rango de ciudad, dotándole de escudo nobiliario, hecho que no tuvo efecto alguno en su franca decadencia.</p>
            </div>
        </div>
    </section>

</div>

